import React from "react";
import { Route } from "react-router-dom";
import { Login, Registration } from "../pages/index.js";

const Auth = () => {
  return (
    <>
      <Route path="/auth/login" element={<Login />} />
      <Route path="/auth/registration" element={<Registration />} />
    </>
  );
};

export default Auth;
